<script setup lang="ts">
import gsap from 'gsap'
import { ScrollTrigger } from 'gsap/ScrollTrigger'
import SplitType from 'split-type'

const wrap = ref()
const svgWrap = ref()
const svg = ref()
const island1 = ref()
const island2 = ref()
const island3 = ref()
const island4 = ref()
const line1 = ref()
const line2 = ref()
const line3 = ref()
const line4 = ref()

onMounted(() => {
  gsap.registerPlugin(ScrollTrigger)

  const islands = [island1.value, island2.value, island3.value, island4.value]
  const lines = [line1.value, line2.value, line3.value, line4.value]

  const islandsSplitText = islands.map((island) => {
    return SplitType.create(island)
  })

  const tl = gsap.timeline({
    scrollTrigger: {
      trigger: wrap.value,
      start: 'top top',
      end: '+=1200%',
      scrub: true,
      pin: true
    },
    defaults: { duration: 1, ease: 'none' }
  })

  gsap.set(svgWrap.value, { transformOrigin: '46% 53%' })

  tl
    .to(
      svg.value,
      { transform: 'translate(1.7%, calc(-1% - 2vh))', duration: 3 }
    )
    .to(
      svgWrap.value,
      { scale: 18, duration: 3 },
      '<'
    )

  islandsSplitText.forEach((island, i) => {
    gsap.set(island.chars, { transformOrigin: 'center top' })

    tl
      .fromTo(
        island.chars,
        { autoAlpha: 0, scaleY: 1.8 },
        { autoAlpha: 1, scaleY: 1, stagger: 0.08 }
      )
      .fromTo(
        lines[i],
        { },
        { onUpdate: function () { lines[i].style.strokeDashoffset = 1 - this.ratio } },
        '<'
      )
      .fromTo(
        island.chars,
        { autoAlpha: 1, scaleY: 1 },
        { autoAlpha: 0, scaleY: 1.8, stagger: 0.1 }
      )
      .fromTo(
        lines[i],
        { },
        { onUpdate: function () { lines[i].style.strokeDashoffset = this.ratio } },
        '<'
      )
  })
})
